import React from "react";
import { ImageBackground, StyleSheet, Text, View } from "react-native";

export default function App() {
  return (
    <ImageBackground
      style={styles.backgroundImage}
      source={require("./assets/BG_Gradient.png")}
    >
      <View style={styles.Datecontainer}>
        <Text>
          <Text style={styles.DateText}>Wednesday<br/> 27 February </Text>
        </Text>
      </View>
    </ImageBackground>
  );
}
const styles = StyleSheet.create({
  backgroundImage: {
    flex: 1,
    resizeMode: "cover",
  },
  Datecontainer: {
    alignItems: 'center',
    justifyContent: 'center',
    paddingTop: "5rem",
  },
  DateText: {
    fontSize: 20,
    color: "#000",
    fontStyle: 'italic',
    fontWeight: '700',
    textAlign: 'center',
  },
});
